import React, { useState, useEffect, useRef } from "react";
import PropTypes from 'prop-types';
import images from "../anime-poster";

function AnimeTable({title}){
    const localImages = Object.values(images); 

    return (
        <>
          <div className="container--animeRow--anime">
            <h1>Anime {title}</h1>
            <div className="container--animeRow--anime--all--list">
                {localImages.map((image, index) => (
                    <div key={index} className="itemes">
                        <a href="#" target="_blank" rel="noopener noreferrer">
                            <img src={image.default} alt={`Image ${index}`} />
                        </a>
                    </div>
                ))}
            </div>
        </div>
        </>
      );

}
export default AnimeTable;

AnimeTable.propTypes = {
    title : PropTypes.string.isRequired
  }
